import React from "react";
import { Container, Nav, Navbar, NavLink } from "react-bootstrap";
function AppBarX() {
  return (
    <div>
      <Navbar bg="light" variant="light">
        <Container>
          <Navbar.Brand href="#home" style={{ fontFamily: "Lato, sans-serif" }}>
            COOP
          </Navbar.Brand>

          <Nav
            className="me-auto"
            style={{ fontFamily: "Lato", fontSize: "80%", padding: "30" }}
          >
            <Nav.Link href="#home">SHOP ALL</Nav.Link>
            <Nav.Link href="#features">LIVING</Nav.Link>
            <Nav.Link href="#pricing">OFFICE</Nav.Link>
            <NavLink href="#">GIFT</NavLink>
          </Nav>
        </Container>
      </Navbar>
    </div>
  );
}

export default AppBarX;
